var ku={city:{get:function(a){var b=[];$.ajax({url:"/city/"+a,dataType:"json",async:!1,success:function(a,d,e){b=a},error:function(c,d,e){"404"==c.status&&(b=ku.city.create(a))}});return b},create:function(a){var b=[];$.ajax({url:"/city/create/"+a,type:"POST",data:{_token:window.Laravel.csrfToken},dataType:"json",success:function(a){b.push(a)}});return b}}};$(document).ready(function(){$("input[name='city']").on("change",function(a){a=ku.city.get($(this).val());console.debug(a);$("input[name='city_id']").val(a[0].id)})});
